@testable import Core
import XCTest

class CallbackActionTests: XCTestCase {
    func testCallbackActionExistsForValidOpenCallbackURL() {
        let urlString = "highlighter://x-callback-url/open?imageData=\(CallbackActionTests.imageDataString)"
        guard let url = URL(string: urlString) else { XCTFail("Unable to create URL"); return }

        let callbackAction = CallbackAction(url: url)
        XCTAssertNotNil(callbackAction)
    }

    func testCallbackActionExistsForValidEditCallbackURL() {
        let urlString = "highlighter://x-callback-url/edit?imageData=\(CallbackActionTests.imageDataString)"
        guard let url = URL(string: urlString) else { XCTFail("Unable to create URL"); return }

        let callbackAction = CallbackAction(url: url)
        XCTAssertNotNil(callbackAction)
    }

    func testCallbackActionDoesNotExistForInvalidActionCallbackURL() {
        let urlString = "highlighter://x-callback-url/foo?imageData=\(CallbackActionTests.imageDataString)"
        guard let url = URL(string: urlString) else { XCTFail("Unable to create URL"); return }

        let callbackAction = CallbackAction(url: url)
        XCTAssertNil(callbackAction)
    }

    func testCallbackActionDoesNotExistForNoImageDataParameter() {
        let urlString = "highlighter://x-callback-url/open"
        guard let url = URL(string: urlString) else { XCTFail("Unable to create URL"); return }

        let callbackAction = CallbackAction(url: url)
        XCTAssertNil(callbackAction)
    }

    func testCallbackActionDoesNotExistForBadImageDataParameter() {
        let urlString = "highlighter://x-callback-url/open?imageData=foo"
        guard let url = URL(string: urlString) else { XCTFail("Unable to create URL"); return }

        let callbackAction = CallbackAction(url: url)
        XCTAssertNil(callbackAction)
    }

    private static let imageDataString = ""
}
